import React from 'react';

import {ConnectToDB} from './components/ConnectToDB';
import {LineBreak} from "./components/LineBreak";


function App() {
  return (
    <div>
      <h1>Connect to database</h1>
        <ConnectToDB />
        <LineBreak />
    </div>
  );
}

export default App;
